def fibfib(n: int, memo=None):
    # Initialize the memoization dictionary if it hasn't been initialized
    if memo is None:
        memo = {}

    # Base cases defined by the sequence rules
    if n == 0:
        return 0
    if n == 1:
        return 0
    if n == 2:
        return 1

    # Check if the result is already computed and stored
    if n in memo:
        return memo[n]

    # Recursive case: compute the result and store it in the memo dictionary
    memo[n] = fibfib(n-1, memo) + fibfib(n-2, memo) + fibfib(n-3, memo)

    # Return the computed value
    return memo[n]

