        'i': 'k', 'I': 'K', 'o': 'q', 'O': 'Q',
        'u': 'w', 'U': 'W'
    }

    encoded_message = []

    for char in message:
        if char in vowels:
            # Swap vowel with corresponding mapped character
            new_char = vowel_replacements[char]
        else:
            new_char = char

