def minPath(grid, k):
    n = len(grid)

    # Utility function to get the value of a position in the grid
    def get_value(x, y):
        if 0 <= x < n and 0 <= y < n:
            return grid[x][y]
        return float('inf')

    # Directions for moving in the grid
    directions = [(-1, 0), (1, 0), (0, -1), (0, 1)]

    # Min-heap to store the paths based on lexicographical order of values visited
    heap = []

    # Initialize heap with all possible starting points
    for i in range(n):
        for j in range(n):
            heappush(heap, ([grid[i][j]], i, j, 1))  # (current_path, x_position, y_position, path_length)

    # Process the heap to find minimum lexicographical path of length k
    while heap:
        path, x, y, length = heappop(heap)

        if length == k:
            return path

        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n:
                new_path = path + [grid[nx][ny]]
                heappush(heap, (new_path, nx, ny, length + 1))

    # In case no path is found, return an empty list (Shouldn't happen due to the problem constraints)
    return []

def tri(n):
    # Define a list to store Tribonacci sequence, starting with tri(0)
    result = [1]

    if n == 0:
        return result

    # Handle initial known values
    if n >= 1:
        result.append(3)  # tri(1) = 3
    if n >= 2:
        result.append(1 + 2 // 2)  # tri(2) = 1 + (2 / 2) = 2
    if n >= 3:
        result.append(8)  # tri(3) = tri(2) + tri(1) + tri(4) based on the given formula

    # Start computations from 4 to n
    for i in range(4, n + 1):
        if i % 2 == 0:
            # If 'i' is even: tri(i) = 1 + i / 2
            result.append(1 + i // 2)
        else:
            # If 'i' is odd: tri(i) = tri(i-1) + tri(i-2) + tri(i+1) where i+1 is even
            # Calculate tri(i+1) as it's not in result yet
            tri_next = 1 + (i + 1) // 2
            tri_current = result[i - 1] + result[i - 2] + tri_next
            result.append(tri_current)

    return result

